import '../css/App.css';
import React from 'react';
import SetTable from './SetTable';
import { connect } from 'react-redux';
//import {store} from '../index.js';

class App extends React.Component{
    handleDispatch(action, deficulty) {
        this.props.dispatch({type: action, value:"easy"});
    }

    screenShow(){
        return (
            <div>
                <SetTable tableShow = {this.props.tableShow}/>
                <div>
                <button>Start!</button>
                </div>
            </div>

        )
    }

    render() {
        console.log(this.props);
        return(
            <div>
                <h1>SET Card - Go!</h1>
                <button onClick = {() => this.handleDispatch("setModeAndStart")}>creatDeck</button>
                {this.screenShow()}
            </div>
        )
    } 
}

let mapDispatchToProps = function(dispatch, props) {
    return {
      dispatch: dispatch,
    }
}

let mapStateTpProps = function(state, props) {
    return {
        gameStarted: state.cards.gameStarted,
        level: state.cards.level,
        deck : state.cards.deck,
        tableShow : state.cards.tableShow,
        selected: state.cards.selected,
    }
}

export default connect(
    mapStateTpProps,
    mapDispatchToProps
)(App)
